import React, { useState } from 'react';
import Sidebar from '../Sidebar';
import AnchorTag from './AnchorTag';
import Meditation from './section/Meditation';
import WorkOut from './section/WorkOut';
import CreateContent from './section/CreateContent';
import MeditationData from './section/static/MeditationData';

function LandingPage(props) {
  const [section, setSection] = useState('home');
  const [mode, setMode] = useState('home');
  const [data, setData] = useState(MeditationData);
  const [content_id, setContent_id] = useState(data.length);
  let _article = null;
  if (mode === 'meditation') {
    _article = <Meditation />
  }else if(mode === 'workout'){
    _article = <WorkOut />
  }else if(mode === 'create'){
    _article = <CreateContent onChangeMode={function(_title,_desc){
      setData([data, ...{id: content_id}])
    }.bind(this)}/>
  }

  return (
    <section>

      <div className='mainname'>
        <p className='test'>프로젝트 100</p>
      </div>
      <br />
      <div>
        <div className='login'>
          login | join with us   |
                </div>
      </div>
      <hr />
      <div>
        <AnchorTag onChangeMode={function (_mode) {
          setMode(_mode);
        }.bind(this)} />
      </div>

      <section className="noticeboard">
        {_article}
      </section>

    </section>
  )
}

export default LandingPage
